import './App.css';
import React from 'react';

function App() {

  const allPokemons = () => {
    return fetch('http://localhost:8080/allPokemons')
      .then(async res => {
        const data = await res.json();
        console.log(data);
      })
      .catch(err => `err`)
  }


  return (
    <div className="App">
    </div>
  );
}

export default App;
